import React from 'react';
import './BrowseByRoom.css';

const BrowseByRoom = () => {
  const rooms = [
    {
      id: 1,
      name: 'Kitchen',
      image: '/images/kitchen.jpg'
    },
    {
      id: 2,
      name: 'Bath',
      image: '/images/bath.jpg'
    },
    {
      id: 3,
      name: 'Bedroom',
      image: '/images/bedroom.jpg'
    },
    {
      id: 4,
      name: 'Living',
      image: '/images/living.jpg'
    },
    {
      id: 5,
      name: 'Dining',
      image: '/images/dining.jpg'
    },
    {
      id: 6,
      name: 'Outdoor',
      image: '/images/outdoor.jpg'
    }
  ];

  return (
    <section className="browse-by-room section">
      <div className="container">
        <h2 className="section-title">Browse Ideas by Room</h2>
        
        <div className="room-grid">
          {rooms.map(room => (
            <div key={room.id} className="room-card card">
              <div className="room-image">
                <img src={room.image} alt={room.name} />
              </div>
              <div className="room-name">
                <h3>{room.name}</h3>
              </div>
            </div>
          ))}
        </div>
        
        <div className="navigation-arrows">
          <button className="nav-arrow prev">‹</button>
          <button className="nav-arrow next">›</button>
        </div>
      </div>
    </section>
  );
};

export default BrowseByRoom;
